using CommunityToolkit.Mvvm.Messaging;
using System;
using System.Diagnostics;
using System.Threading.Tasks;
using TrarsUI.Shared.Messages;

namespace vNekoChatUI.A.MVVM.Models
{
    internal partial class DefaultProfile
    {
        const string version = "20250120";

        private string start { get; set; } = "";
        private string system { get; set; } = "";
        private string charA { get; set; } = "";
        private string charB { get; set; } = "";
        private string story { get; set; } = "";
        private string output { get; set; } = "";
        private string end { get; set; } = "UyuuXYyxDw6lk29xQn+l+HQLy9fQWR0WtLjhamgC99zyosDziRlWgv+OZWfYLvCjD3Vhdv5kjLCjYCNmvMY2eA==";
        private string @continue { get; set; } = "";

        string defAesKey;
        string defToken;

        public DefaultProfile(string aesKey, string token)
        {
            defAesKey = aesKey;
            defToken = token;

            Task.Run(async () =>
            {
                try
                {
                    start = await AesDecrypt(start);
                    system = await AesDecrypt(system);
                    charA = await AesDecrypt(charA);
                    charB = await AesDecrypt(charB);
                    story = await AesDecrypt(story);
                    output = await AesDecrypt(output);
                    end = await AesDecrypt(end);
                    @continue = await AesDecrypt(@continue);
                }
                catch (Exception ex)
                {
                    Debug.WriteLine($"DefaultProfile: {ex.Message}");
                }
            }).Wait();
        }
    }

    internal partial class DefaultProfile
    {
        public string GetDefaultProfile()
        {
            var result = start + "\n";
            result += system + "\n";
            result += charA + "\n";
            result += charB + "\n";
            result += story + "\n";
            result += output + "\n";
            result += end;

            return result.Replace("\n\n", "\n");
        }

        public string GetDefaultContinuePrompt()
        {
            return @continue.Replace("\n\n", "\n");
        }
    }

    internal partial class DefaultProfile
    {
        private async Task<string> AesDecrypt(string text)
        {
            if (!System.Buffers.Text.Base64.IsValid(text)) { return text; }

            var response = await WeakReferenceMessenger.Default.Send(new StringDecryptMessage()
            {
                AesKey = defAesKey,
                TextSrc = text
            }, defToken);
            return (response + "\n\n");
        }
    }
}
